import React from 'react';


export const Product = (props) => {
    const { nombre, precio, descripcion, img1 } = props.data;
  

    return (
        <div className="product">
            <div className="slide-var">
                <Link to="/login">
                    <ul>
                        <li><img className="logo" src={require("./pro1.png")}/></li>
                    </ul>
                </Link>
            </div>
            <Link to="/login">
                <div className="descripcion">
                    <p>{descripcion}</p>
                </div>
                <div className="description"> 
                    <p> <b>{nombre}</b></p>
                    <p> ${precio}</p>
                </div>
            </Link>
        </div> 
    );
};
